{
  "version": 0.2,
  "phases": {
    "install": {
      "runtime-versions": {
        "nodejs": "latest"
      }
    },
    "build": {
      "commands": [
        "echo Build started on `date`",
        "pwd",
        "ls",
        "cd express-minapp/",
        "echo HOST=$HOST >> .env",
        "echo USERNAME=$USERNAME >> .env",
        "echo PASSWORD=$PASSWORD >> .env",
        "echo DATABASE=$DATABASE >> .env",
        "npm install"
      ]
    },
    "post_build": {
      "commands": [
        "echo Build completed on `date`"
      ]
    }
  },
  "artifacts": {
    "files": [
      "package.json",
      "src/index.js",
      "src/middlewares.js",
      "package-lock.json",
      ".env"
    ],
    "name": "express-minapp",
    "base-directory": "express-minapp"
  },
  "cache": {
    "paths": [
      "node_modules/**/*"
    ]
  }
}
